import React,{Component} from 'react';

export class AppFooter extends Component {

    render() {
        return (
            <div className="layout-footer">
                <img src="assets/layout/images/AmaTusPies.png" alt="" width="80" />
                <span className="footer-text" style={{'marginRight': '5px'}}>Examen</span>
            </div>
        );
    }
}
